import React from 'react';
import { Link } from 'react-router-dom';

const PizzaCard = ({ name, price, unit }) => {
  return (

     <Link className="no-underline" to="pizza={pizza}">
        <div className="mw5 center bg-white br4 pa3 pa4-ns mv3 ba b--black-10">
      <div className="tc">
        <img className="br-100 h4 w4 dib pa" src={process.env.PUBLIC_URL + `/assets/pizza1`}

          />
        <h1 className="f3 mb2" style={{color:'#000'}}>{name}</h1>
        <h2 className="f4 fw4" style={{color:'#FF9100'}}>{price} / {unit}</h2>
      </div>  
     </div>
     </Link>
  );
};

export default PizzaCard;
